        public string[] Parser()
        {
            if(!(tokens.Count > 0))
            {
                contenido[0] = "NO SE ENCONTRO CODIGO A EJECUTAR";
                contenido[1] = "PROGRAMA SEMANTICAMENTE INCORRECTO";
            }
            else
            {
                bool salida = EstructuraLenguaje();
                if (salida)
                {
                    contenido[0] = "PROGRAMA SINTACTICAMENTE CORRECTO";
                }
                else
