                    contenido[0] = "PROGRAMA SINTACTICAMENTE INCORRECTO";
                }
            }
            return contenido;
        }
        private int SigCodigo()
        {
            return tokens[++index].Codigo;
        }
        private bool EstructuraLenguaje()
        {
            bool salida = false;
            
            if (SigCodigo().Equals(1) && index < ultimo)
            {
                if(SigCodigo().Equals(0) && index < ultimo)
                {
                    semantico.AñadirID(tokens[index].Lexema, 0);
                    salida = InstruccionesAlgoritmo();
                }
                else
                {
                    salida = false;
                }
            }
            else
            {
                salida = false;
            }
            return salida;
        }
        //Incluye cierre e inicio de if
        private bool InstruccionesAlgoritmo()
        {
            bool salida = false;
            
            SigCodigo();
            if (index > ultimo) return false;

            switch (tokens[index].Codigo)
            {
                case 0:
                    salida = AsignacionPadreAlgoritmo();
                    break;
                case 2:
                    if(index == ultimo)
                    {
                        if(errorSemantico == false) contenido[1] = "PROGRAMA SEMANTICAMENTE CORRECTO";

                        salida = true;
                    }
                    break;
                case 3:
                    salida = Declaracion();
                    break;
                case 20:
                    salida = SentenciaIF();
                    break;
                case 24:
                    salida = SentenciaWhile();
                    break;
                case 33:
                    salida = ImpresionPadreAlgoritmo();
                    break;
                case 34:
                    salida = LeerPadreAlgoritmo();
                    break;
            }
            return salida;
        }
